    private static int c = 1;
    private static void doRun(int expected, int[][] matrix, int target){
        int res = new N1074HNumberofSubmatricesThatSumtoTarget().numSubmatrixSumTarget(matrix, target);
        System.out.println("[" + (expected ==res) +"] "+(c++)+ ".result: "+ res + ".expected:"+expected);
    }

    //Runtime: 170 ms, faster than 89.33% of Java online submissions for Number of Submatrices That Sum to Target.
    //Memory Usage: 42.7 MB, less than 98.01% of Java online submissions for Number of Submatrices That Sum to Target.
    //(see 560 Subarray Sum Equals K)
    //time: O(RCC) ; space O(C)
    public int numSubmatrixSumTarget(int[][] matrix, int target) {
        if (matrix.length == 1 && matrix[0].length == 1){
            return  matrix[0][0] == target? 1:0;
        }

        //pre-compute
        for(int i = 0; i< matrix.length; i++){
            for(int j = 0; j<matrix[0].length; j++){
                int val = 0;
                if (j - 1 >= 0) val += matrix[i][j - 1];
                if (i - 1 >= 0) val += matrix[i - 1][j];
                if (i - 1 >= 0 &&  j - 1 >= 0) val -= matrix[i - 1][j - 1];
                matrix[i][j] = matrix[i][j] + val;
            }
        }

        //count
        int res = 0;
        for(int i = 0; i< matrix.length; i++) {
            res += subarrayCount(matrix[i], target);

            for(int c = 0; c < i;c++) {
                int[] nums = new int[matrix[i].length];
                for (int j = 0; j < nums.length; j++)
                    nums[j] = matrix[i][j] - matrix[c][j];
                res += subarrayCount(nums, target);
            }
        }
        return  res;
    }

    //count by subarray (see 560 Subarray Sum Equals K)
    private int subarrayCount(int[] nums, int target) {
        int res = 0;
        Map<Integer, Integer> map = new HashMap<>();
        map.put(0, 1);
        for (int j = 0; j < nums.length; j++) {
            if (map.containsKey(nums[j] - target)) res += map.get(nums[j] - target);
            map.put(nums[j], map.getOrDefault(nums[j], 0) + 1);
        }
        return res;
    }
